import {
    CHANGE_SEARCH_FIELD,
    CHANGE_SORT_VALUE,
    CHANGE_STATUS_VALUE,
    ADD_DATA,
    CHANGE_DEPT_FILTER,
    SET_ROW_SELECTED,
    SET_ROW_NOT_SELECTED,
    RESET_ROW_SELECTED,
    REMOVE_TYPE_SELECT,
    REMOVE_LANGUAGE_SELECT,
    REMOVE_MARKET_SELECT,
    ADD_LANGUAGE_SELECT,
    ADD_TYPE_SELECT,
    ADD_MARKET_SELECT,
    EDIT_LANGUAGE_SELECT,
    EDIT_MARKET_SELECT,
    EDIT_TYPE_SELECT,
    FILE_UPLOAD_COMPLETE,
    FILE_UPLOAD_IN_PROGRESS,
    FILE_SUBMIT_COMPLETE,
    CHANGE_USER_EDIT_DOC_REPO_STATUS,
    CHANGE_ADMIN_EDIT_DOC_REPO_STATUS,
    CHANGE_SELECTED_ROW_USER_DOC_REPO,
    CHANGE_SELECTED_ROW_ADMIN_DOC_REPO,
    EDIT_DATA,
    CHANGE_USER_EDIT_DATA_FIELD_SELECTED,
    CHANGE_ADMIN_EDIT_DATA_VALUE_SELECTED,
    CHANGE_USER_EDIT_DATA_VALUE_SELECTED,
    CHANGE_ADMIN_EDIT_DATA_FIELD_SELECTED,
    LOG_IN,
    SET_USER,
    SET_DEPT,
    DELETE_DATA,
    ADD_ACTIVITY
} from './constants'

export const setSearchField = (text) => ({
    type: CHANGE_SEARCH_FIELD,
    payload: text
})

export const setSort = (text) => ({
    type: CHANGE_SORT_VALUE,
    payload: text
})

export const setStatus = (text) => ({
    type: CHANGE_STATUS_VALUE,
    payload: text
})

export const addData = (data) => ({
    type: ADD_DATA,
    payload: data
})

export const setDept = (text) => ({
    type: CHANGE_DEPT_FILTER,
    payload: text
})

export const setRowSelected = (key) => ({
    type: SET_ROW_SELECTED,
    payload: key
})

export const setRowNotSelected = (key) => ({
    type: SET_ROW_NOT_SELECTED,
    payload: key
})

export const resetRowSelected = (key) => ({
    type: RESET_ROW_SELECTED,
    payload: key
})

export const removeTypeSelect = (key) => ({
    type: REMOVE_TYPE_SELECT,
    payload: key
})

export const removeMarketSelect = (key) => ({
    type: REMOVE_MARKET_SELECT,
    payload: key
})

export const removeLanguageSelect = (key) => ({
    type: REMOVE_LANGUAGE_SELECT,
    payload: key
})

export const addTypeSelect = (option) => ({
    type: ADD_TYPE_SELECT,
    payload: option
})

export const addMarketSelect = (option) => ({
    type: ADD_MARKET_SELECT,
    payload: option
})

export const addLanguageSelect = (option) => ({
    type: ADD_LANGUAGE_SELECT,
    payload: option
})

export const editTypeSelect = (option) => ({
    type: EDIT_TYPE_SELECT,
    payload: option
})

export const editMarketSelect = (option) => ({
    type: EDIT_MARKET_SELECT,
    payload: option
})

export const editLanguageSelect = (option) => ({
    type: EDIT_LANGUAGE_SELECT,
    payload: option
})

export const setFileUploadStatus = (text) => ({
    type: FILE_UPLOAD_COMPLETE,
    payload: text
})

export const setFileUploadInProgress = (bool) => ({
    type: FILE_UPLOAD_IN_PROGRESS,
    payload: bool
})

export const setFileSubmitStatus = (bool) => ({
    type: FILE_SUBMIT_COMPLETE,
    payload: bool
})

export const setUserEditDocRepoStatus = (bool) => ({
    type: CHANGE_USER_EDIT_DOC_REPO_STATUS,
    payload: bool
})

export const setAdminEditDocRepoStatus = (bool) => ({
    type: CHANGE_ADMIN_EDIT_DOC_REPO_STATUS,
    payload: bool
})

export const setRowSelectedUserDocRepo = (key) => ({
    type: CHANGE_SELECTED_ROW_USER_DOC_REPO,
    payload: key
})

export const setRowSelectedAdminDocRepo = (key) => ({
    type: CHANGE_SELECTED_ROW_ADMIN_DOC_REPO,
    payload: key
})

export const editData = (data) => ({
    type: EDIT_DATA,
    payload: data
})

export const changeUserEditDataFieldSelected = (key) => ({
    type: CHANGE_USER_EDIT_DATA_FIELD_SELECTED,
    payload: key
})

export const changeAdminEditDataFieldSelected = (key) => ({
    type: CHANGE_ADMIN_EDIT_DATA_FIELD_SELECTED,
    payload: key
})

export const changeUserEditDataValueSelected = (text) => ({
    type: CHANGE_USER_EDIT_DATA_VALUE_SELECTED,
    payload: text
})

export const changeAdminEditDataValueSelected = (text) => ({
    type: CHANGE_ADMIN_EDIT_DATA_VALUE_SELECTED,
    payload: text
})

export const logIn = (text) => ({
    type: LOG_IN,
    payload: text
})

export const setUser = (user) => ({
    type: SET_USER,
    payload: user
})

export const setUserDept = (dept) => ({
    type: SET_DEPT,
    payload: dept
})
export const deleteData = (key) => ({
    type: DELETE_DATA,
    payload: key
})

export const addActivity = (data) => ({
    type: ADD_ACTIVITY,
    payload: data
})
